import './App.css';
import Appbar from './components/Appbar';
import { useParams } from 'react-router-dom';
import Paper from '@mui/material/Paper';
import React, { useEffect, useState } from 'react';


function Result() {
  const { id, dep } = useParams();

  const myStyle = {
    backgroundColor: "#eb8934",
    backgroundSize: 'cover',
    minHeight: "100vh",
    backgroundRepeat: 'repeat',
  };

  const [data, setData] = useState();

  useEffect(() => {
    if (true){
        fetch(`http://localhost:8080/search?author=darshan`)
  .then(response => response.json())
  .then(datar => {
    setData(datar);
  })
  .catch(error => {
    console.error('Error fetching data:', error);
  });
    }
}, [dep, id, setData]);

  return (
    <div className="App" style={myStyle}>
      <Appbar />
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Author: {data.author}</h3>
    </>
  )}
      </Paper>
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Date Created: {data.date_Cr}</h3>
    </>
  )}
      </Paper>
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Data Modified : {data.date_Md}</h3>
    </>
  )}
      </Paper>
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Setup: {data.setup}</h3>
    </>
  )}
      </Paper>
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Functional Overview: {data.funcover}</h3>
    </>
  )}
      </Paper>
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Collections: {data.coll}</h3>
    </>
  )}
      </Paper>
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Id: {data.id}</h3>
    </>
  )}
      </Paper>
      <Paper elevation={3}
      style = {{padding : '3em', width : 'fit-content',height : 'fit-content', margin : 'auto'}}
      >
      {data && (
    <>
      <h3>Description: {data.description}</h3>
    </>
  )}
      </Paper>

    </div>
  );
}

export default Result;
